import Vue from 'vue';
export default Vue.extend({
    name: 'MapComponent',
    mounted() {
        this.animateMarker();
    },
    methods: {
        animateMarker() {
            const anime = (this as any).$anime;

            const markerBg = this.$refs.markerBg as HTMLElement;

            const tl = anime.timeline({
                duration: 1000,
                easing: 'easeInOutQuad',
                loop: true,
            });

            tl.add({
                targets: markerBg,
                duration: 1250,
                delay: 250,
                opacity: [0.75, 0],
                scale: [0.5, 1.1],
            });
        },
    },
});
</script>
